              <Header />
            </div>
            <div className="col-md-3 col-0" >

            </div>

            <div className="col-md-6 col-12">
              <h3 style={{color:"#145CA8",fontFamily:"PoppinsSemiBold"}} className="pt-5">Binusian Posts</h3>
              <div>
                <div className="col-md-12 p-3 forumPost">
                <div class="row m-0 p-0">
                  <div class="col-md-1 col-2 p-0">
                    <img id="" src="/assets/user_dp.png" class="img-fluid" width="75%" alt=""/>
                  </div>
                  <div class="col-md-10 col-9  p-0">
                    <a href="#" style={{fontFamily:"PoppinsSemiBold",fontSize:"18px",marginBottom:"0px !important",color:"#262626",textDecoration:"none"}}>Fernandha Dzaky</a>
                    <p style={{fontFamily : "PoppinsLight", fontSize:"12px"}}>Computer Science</p>
                    <p style={{fontFamily : "PoppinsRegular",fontSize:"16px",marginBottom:"15px !important"}}>this is a post contennt</p>

                  </div>
                </div>

                </div>

              </div>

            </div>

            <div className="col-md-3 col-0" >

            </div>
          </div>

          {/*<p>test</p>*/}


        </div>
      )
  }
}

export default HomePage;
